import React from 'react';
import styled from "@emotion/styled";
import Footer from '../Components/Footer/Footer'
import Topbar from '../Components/Bars/Topbar'
import Organizers from '../Components/Organizers/Organizers'


const PromoteSection = styled.section`
  min-height: 45vh;
  margin-top: 64px;
  background: #112;
  color: #eee;
  padding: 10vh 2vw;
  display: flex;
  align-items: center;
  justify-content: center;
  text-align: center;
  h1 {
    color: #FFAB00;
    font-size: calc(1.8rem + 2vw);
    font-weight: 600;
  }
  h3 {
    color: #FFAB00;
    font-size: calc(1.5rem + 1vw);
  }
  h4 {
    color: #fd7e14;
    font-size: calc(1.8rem + 2vw);
    font-weight: 600;
  }
  blockquote {
    text-align: center;
  }
`;


const WhatsAppMessageSection = styled.section`
  background: #fff;
  color: #000;
  border-radius: 12px;
  border: 4px solid #FFAB00;
  text-align: left;
  padding: 1rem;
  margin-bottom: 1rem;
  h3 {
      color: #fd7e14;
  }
`;

function Promote() {
    return (
        <div>
            <Topbar />
        <PromoteSection>

            </PromoteSection>
        <Organizers />
        <Footer />
        </div>
    )
}

export default Promote
